"""# Definiciones y limpieza de datos"""

#Definimos las imgenes con tumor y sin tumor

sin_tumor = "/content/extraido/no"
con_tumor = "/content/extraido/yes"

# Contamos las imgenes
con_tumor = len(os.listdir(con_tumor))
sin_tumor = len(os.listdir(sin_tumor))

print(f"Nmero de imgenes con tumores : {con_tumor}")
print(f"Nmero de imgenes sin tumores : {sin_tumor}")

#Limpiamos datos corruptos
num_skipped = 0
for folder_name in ("no", "yes"):
    folder_path = os.path.join("extraido", folder_name)
    for fname in os.listdir(folder_path):
        fpath = os.path.join(folder_path, fname)
        try:
            with open(fpath, "rb") as fobj:  #with open() para cerrar automticamente el archivo.
                is_jfif = tf.compat.as_bytes("JFIF") in fobj.read(10)
            if not is_jfif:
                num_skipped += 1
                os.remove(fpath)
        except Exception as e:
            print(f" Error con {fpath}: {e}")
            num_skipped += 1
            os.remove(fpath)

print("Deleted %d images" % num_skipped)

print(f"Nmero de imgenes con tumores : {con_tumor}")
print(f"Nmero de imgenes sin tumores : {sin_tumor}")

con_tumor = "/content/extraido/brain_tumor_dataset/yes"
sin_tumor = "/content/extraido/brain_tumor_dataset/no"

"""# Visualizacin de imgenes"""

#Visualizar imgenes
def show_images(brain_tumor_dataset, tumor, num_images=4): #4 imgenes por cada carpeta
    images = random.sample(os.listdir(brain_tumor_dataset), num_images)
    fig, axes = plt.subplots(1, num_images, figsize=(15, 5))

    for i, img_name in enumerate(images):
        img_path = os.path.join(brain_tumor_dataset, img_name)
        img = cv2.imread(img_path)
        img = cv2.cvtColor(img, cv2.COLOR_BGR2RGB)
        axes[i].imshow(img)
        axes[i].axis("off")
        axes[i].set_title(tumor)

    plt.show()

show_images(con_tumor, "Con Tumor")
show_images(sin_tumor, "Sin Tumor")

"""# Estructura y entrenamiento del modelo"""

#Separamos las carpetas para entrenar todo

base_dir = "brain_tumor_dataset"
sub_dirs = ["train", "validation", "test"]

for sub in sub_dirs:
    path = os.path.join(base_dir, sub)
    os.makedirs(path, exist_ok=True)

print("Estructura de carpetas creada correctamente.")

#Este cdigo distribuye las imgenes en train, validation y test:

base_dir = "/content/extraido/brain_tumor_dataset"
categories = ["no", "yes"]
split_ratio = [0.7, 0.15, 0.15]  # 70% train, 15% val, 15% test

for category in categories:
    src_folder = os.path.join(base_dir, category)
    images = [f for f in os.listdir(src_folder) if f.endswith(("jpg", "png", "jpeg"))]
    random.shuffle(images)

    train_split = int(len(images) * split_ratio[0])
    val_split = int(len(images) * (split_ratio[0] + split_ratio[1]))

    for i, img in enumerate(images):
        src_path = os.path.join(src_folder, img)
        if i < train_split:
            dst_folder = os.path.join(base_dir, "train", category.lower())
        elif i < val_split:
            dst_folder = os.path.join(base_dir, "validation", category.lower())
        else:
            dst_folder = os.path.join(base_dir, "test", category.lower())

        os.makedirs(dst_folder, exist_ok=True)
        shutil.move(src_path, os.path.join(dst_folder, img))

print("Imgenes organizadas correctamente en train, validation y test.")

# Define the CNN model
model = Sequential([
    # First Conv layer
    Conv2D(32, (3,3), activation='relu', input_shape=(128, 128, 3)), #Aunque est en blanco y negro, pongo RGB para entrenar mejor al modelo
    MaxPooling2D(2,2),

    # Second Conv layer
    Conv2D(64, (3,3), activation='relu'),
    MaxPooling2D(2,2),

    # Third Conv layer
    Conv2D(128, (3,3), activation='relu'),
    MaxPooling2D(2,2),

    # Flatten the features
    Flatten(),

    # Fully connected layer
    Dense(128, activation='relu'),
    Dropout(0.5),  # Prevents overfitting
    Dense(1, activation='sigmoid')  # Binary classification (Tumor or No Tumor)
])

# Compile the model
model.compile(optimizer='adam', loss='binary_crossentropy', metrics=['accuracy'])






# Print model summary
model.summary()

# Parmetros
batch_size = 32
img_size = (128, 128)  # Mismos parmetros que el input_shape del modelo

# Cargar datasets
train_ds = tf.keras.utils.image_dataset_from_directory(
    directory="/content/extraido/brain_tumor_dataset/train",
    image_size=img_size,
    batch_size=batch_size,
    label_mode="binary"  # Para clasificacin binaria
)

val_ds = tf.keras.utils.image_dataset_from_directory(
    directory="/content/extraido/brain_tumor_dataset/validation",
    image_size=img_size,
    batch_size=batch_size,
    label_mode="binary"
)

test_ds = tf.keras.utils.image_dataset_from_directory(
    directory="/content/extraido/brain_tumor_dataset/test",
    image_size=img_size,
    batch_size=batch_size,
    label_mode="binary"
)

# Normalizar los valores de los pxeles (0 a 1)
normalization_layer = tf.keras.layers.Rescaling(1./255)

train_ds = train_ds.map(lambda x, y: (normalization_layer(x), y))
val_ds = val_ds.map(lambda x, y: (normalization_layer(x), y))
test_ds = test_ds.map(lambda x, y: (normalization_layer(x), y))

# Mejorar el rendimiento del dataset
AUTOTUNE = tf.data.AUTOTUNE
train_ds = train_ds.prefetch(buffer_size=AUTOTUNE)
val_ds = val_ds.prefetch(buffer_size=AUTOTUNE)
test_ds = test_ds.prefetch(buffer_size=AUTOTUNE)

# Entrenar el modelo con los datasets creados
history = model.fit(
    train_ds,  # Dataset de entrenamiento
    validation_data=val_ds,  # Dataset de validacin
    epochs=20,  # Nmero de pocas
    batch_size=23  # Tamao del batch
)

# Evaluamos el modelo en el conjunto de prueba
test_loss, test_acc = model.evaluate(test_ds)
print(f"Test Accuracy: {test_acc * 100:.2f}%")

model.save("modelo_tumores.h5")

import pickle

with open("historial_entrenamiento.pkl", "wb") as f:
    pickle.dump(history.history, f)

"""# Anlisis de datos"""

# Plot training and validation accuracy
plt.plot(history.history['accuracy'], label='Training Accuracy')
plt.plot(history.history['val_accuracy'], label='Validation Accuracy')
plt.legend()
plt.xlabel("Epochs")
plt.ylabel("Accuracy")
plt.title("Training vs Validation Accuracy")
plt.show()

# Plot training and validation loss
plt.plot(history.history['loss'], label='Training Loss')
plt.plot(history.history['val_loss'], label='Validation Loss')
plt.legend()
plt.xlabel("Epochs")
plt.ylabel("Loss")
plt.title("Training vs Validation Loss")
plt.show()

import seaborn as sns
from sklearn.metrics import roc_auc_score, roc_curve, confusion_matrix, classification_report
# Crear listas vacas para almacenar las etiquetas y las predicciones
y_val = []
y_pred = []

# Iterar por los batches de val_ds
for images, labels in val_ds:
    # Almacenamos las etiquetas verdaderas
    y_val.extend(labels.numpy())

    # Generamos las predicciones
    preds = model.predict(images)
    y_pred.extend(preds)

# Convertimos las listas en arrays de numpy
y_val = np.array(y_val)
y_pred = np.array(y_pred)

# Calcular el ROC-AUC Score
roc_auc = roc_auc_score(y_val, y_pred)

print(f"ROC-AUC Score: {roc_auc:.4f}")

# Calculamos la curva ROC
fpr, tpr, thresholds = roc_curve(y_val, y_pred)

# Graficamos la curva ROC
plt.figure(figsize=(8, 6))
plt.plot(fpr, tpr, label='ROC Curve', color='b')
plt.plot([0, 1], [0, 1], 'k--')  # Lnea diagonal (sin discriminacin)
plt.title('Curva ROC')
plt.xlabel('Tasa de Falsos Positivos (FPR)')
plt.ylabel('Tasa de Verdaderos Positivos (TPR)')
plt.legend()
plt.show()

# Convertimos las predicciones en valores binarios (0 o 1) con un umbral de 0.5
y_pred_binary = (y_pred > 0.5).astype("int32")

# Matriz de Confusin
conf_matrix = confusion_matrix(y_val, y_pred_binary)

# Graficar la matriz de confusin
plt.figure(figsize=(6, 6))
sns.heatmap(conf_matrix, annot=True, fmt="d", cmap="Blues", cbar=False,
            xticklabels=["No Tumor", "Con Tumor"], yticklabels=["No Tumor", "Con Tumor"])
plt.title("Matriz de Confusin")
plt.xlabel("Prediccin")
plt.ylabel("Real")
plt.show()

# Reporte de Clasificacin
print("Reporte de Clasificacin:")
print(classification_report(y_val, y_pred_binary, target_names=["No Tumor", "Con Tumor"]))

